FTL: Faster Than Light version 1.5.4

This version includes the Advanced Edition. No DRM, simply download and run FTLGame.exe


If you like the game, support the Developers and buy it!


//Official website: www.ftlgame.com
//Official Steam Store page: store.steampowered.com/app/212680
//Official description from the publisher:

In FTL you experience the atmosphere of running a spaceship trying to save the galaxy. It's a dangerous mission, with every encounter presenting a unique challenge with multiple solutions. What will you do if a heavy missile barrage shuts down your shields? Reroute all power to the engines in an attempt to escape, power up additional weapons to blow your enemy out of the sky, or take the fight to them with a boarding party? This &quot;spaceship simulation roguelike-like&quot; allows you to take your ship and crew on an adventure through a randomly generated galaxy filled with glory and bitter defeat.
